from datetime import datetime

class FABSUser:
    def __init__(self, username):
        self.username = username
        self.submissions = {}

    def submit_fabs_file(self, file_path):
        file_name = os.path.basename(file_path)
        self.submissions[file_name] = {"status": "pending", "upload_time": datetime.now()}
        return f"File {file_name} submitted successfully."

    def check_submission_status(self, file_name):
        if file_name in self.submissions:
            return self.submissions[file_name]["status"]
        else:
            return "File not found."

    def download_fabs_file(self, file_name):
        if file_name in self.submissions:
