class Developer:
    def __init__(self, username):
        self.username = username
        self.fabs_submissions = {}

    def add_updates_to_fabs_submission(self, file_name, updates):
        if file_name in self.fabs_submissions:
            self.fabs_submissions[file_name].update(updates)
            return f"Updates added to {file_name} successfully."
        else:
            return "File not found."

    def update_fabs_sample_file(self, file_path, updates):
        file_name = os.path.basename(file_path)
        # Simulating file update
        return f"File {file_name} updated successfully."

    def prevent_duplicate_transactions(self, transactions):
        unique_transactions = []
        for transaction in transactions:
            if transaction not in unique_transactions:
                unique_transactions.append(transaction)
        return unique_transactions


